```swift
import UIKit

class StackedImagesView: UIView {
    private var imageViews: [UIImageView] = []
    private let iconScale: CGFloat = 0.7

    init(images: [UIImage]) {
        super.init(frame: .zero)

        for image in images {
            let imageView = UIImageView(image: image)
            imageView.contentMode = .scaleAspectFit
            imageViews.append(imageView)
            addSubview(imageView)
        }

        updateLayout()
    }

    required init?(coder: NSCoder) {
        fatalError("init(coder:) has not been implemented")
    }

    override func layoutSubviews() {
        super.layoutSubviews()
        updateLayout()
    }

    private func updateLayout() {
        let newWidth = bounds.width
        let iconsSize = floor(newWidth * iconScale)
        let iconsInset = (newWidth - iconsSize) - 1

        for (index, imageView) in imageViews.enumerated() {
            let size = CGSize(width: iconsSize, height: iconsSize)
            let origin = CGPoint(x: iconsInset, y: iconsInset)

            switch index {
            case 1:
                imageView.frame = CGRect(origin: origin, size: size)
            case 0:
                imageView.frame = CGRect(origin: CGPoint(x: iconsInset, y: 0), size: size)
            default:
                break
            }
        }
    }
}
```

