Static variables and register variables are two types of variables in C programming language.

1. Static Variables:
A static variable is a variable that has been allocated statically, i.e., at compile time. It retains its value between function calls. The default value of a static variable is 0.

There are two types of static variables in C:

a. Local Static Variable:
A local static variable is a variable that is declared as static inside a function. It is initialized only once and retains its value between function calls.

Example:
```c
#include <stdio.h>

void func() {
    static int count = 0;
    count++;
    printf("Count: %d\n", count);
}

int main() {
    func();
    func();
    func();
    return 0;
}
```
Output:
```
Count: 1
Count: 2
Count: 3
```

b. Global Static Variable:
A global static variable is a variable that is declared as static outside of any function. It is visible only within the file in which it is declared.

Example:
```c
#include <stdio.h>

static int count = 0;

void func() {
    count++;
    printf("Count: %d\n", count);
}

int main() {
    func();
    func();
    func();
    return 0;
}
```
Output:
```
Count: 1
Count: 2
Count: 3
```

